import './Reviews.css';

import reviews from './revs.json'

const Reviews = () => {

  let data = reviews.data
  console.log(data)


  return (
    <>
      {
      data.map((review => (
        <div key={review} className='reviews-container'>
          <p>{review.author_title}</p>
        </div>
      )))
      }
    </>
  );
};

export default Reviews;
